  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from November of 1938 through January
  of 1939. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds, upland game birds, predators, and rodents-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. Resource management is outlined; topics include fur
  harvesting. The public relations section of the report describes recreational uses,
  Refuge visitors, and hunting. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
